export const googleAutocomplete = async text =>
  new Promise((resolve, reject) => {
    if (!text) {
      return reject("Need valid text input")
    }

    // for use in things like GatsbyJS where the html is generated first
    if (typeof window === "undefined") {
      return reject("Need valid window object")
    }

    try {
      new window.google.maps.places.Autocomplete(text, {
        types: ['geocode'],
        componentRestrictions: { country: 'es' },
      },);
      /* AutocompleteService().getPlacePredictions(
        { input: text, types: ['geocode'] ,componentRestrictions: { country: "es" } },
        resolve
      ) */
    } catch (e) {
      reject(e)
    }
  })
